import React, { useEffect } from 'react'
import { Image, Text, View, FlatList, Dimensions, Button } from 'react-native'

// Packages
import { SharedElement } from 'react-navigation-shared-element';
// import TouchableScale from 'react-native-touchable-scale';

//Sample Data
import { data, profile, popular } from '../data'

// Icons
import { Feather } from '@expo/vector-icons'
import { useDispatch, useSelector } from 'react-redux';
import { loadSingleBlogData } from '../redux/Actions/Actions';
import Header from '../components/Header/Header';
import SharedBlogs from '../components/SharedBlogs/SharedBlogs';
import PopularBlogs from '../components/PopularBlogs/PopularBlogs';


const MainScreen = ({ navigation }) => {

  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(loadSingleBlogData(2))
  }, [])

  useSelector(state => console.log(state))

  const { width, height } = Dimensions.get('window')

  return (
    <View style={{ flex: 1 }}>

      <Header profile={profile} />
      
      {/* <SharedBlogs data={data} /> */}

      <PopularBlogs popular={popular} />

    </View>
  );
}

export default MainScreen;
